<script setup>
import { ref, computed, onMounted } from 'vue'
import { XMarkIcon, CheckCircleIcon, LinkIcon } from '@heroicons/vue/24/solid'
import { useForm, Link, usePage } from '@inertiajs/inertia-vue3'
import AlertError from '@/Components/Modals/AlertError.vue'
import { useAlert } from '@/Composables/useAlert.js';
import axios from 'axios';
import { MegaphoneIcon, DocumentTextIcon, BuildingLibraryIcon } from '@heroicons/vue/24/outline';

const props = defineProps({
    // loginUrl: { type: String, default: '' },
    mobileUrl: { type: String, default: 'data:image/svg+xml;base64,' },
    loginUrl: { type: String, default: 'data:image/svg+xml;base64,' },
})

const page = usePage();
const { success, error } = useAlert();

// Tambahkan ref ke komponen modal
const alertError = ref(null)

const form = useForm({
    email: '',
    password: '',
    remember: false,
})

const showPassword = ref(false)
const isEmailFocused = ref(false)
const isPasswordFocused = ref(false)

const togglePassword = () => {
    showPassword.value = !showPassword.value
}

// ===== Email Suggestion =====
const emailSuggestions = ref([]);
const suggestions = computed(() => emailSuggestions.value);
const clearSuggestions = () => {
    setTimeout(() => {
        emailSuggestions.value = [];
    }, 150);
};

// Ambil riwayat email
const savedEmails = ref([]);

// Load setelah mount
onMounted(() => {
    savedEmails.value = JSON.parse(localStorage.getItem("saved_emails") || "[]");
});

// Update suggestion (limit 5)
const updateSuggestion = () => {
    if (!form.email) {
        emailSuggestions.value = [];
        return;
    }

    emailSuggestions.value = savedEmails.value
        .filter(e => e.toLowerCase().includes(form.email.toLowerCase()))
        .slice(0, 5); // LIMIT 5
};

// Klik suggestion
const chooseEmail = (email) => {
    form.email = email;
    emailSuggestions.value = [];
};

// Simpan email
const saveEmailToHistory = () => {
    if (form.email && !savedEmails.value.includes(form.email)) {
        savedEmails.value.unshift(form.email); // push ke depan
        savedEmails.value = savedEmails.value.slice(0, 5); // simpan 5 terbaru
        localStorage.setItem("saved_emails", JSON.stringify(savedEmails.value));
    }
};

// Hapus semua history email
const clearEmailHistory = () => {
    savedEmails.value = [];
    localStorage.removeItem("saved_emails");
    emailSuggestions.value = [];
};

// Hapus 1 email dari riwayat
const deleteSingleEmail = (email) => {
    savedEmails.value = savedEmails.value.filter(e => e !== email);
    localStorage.setItem("saved_emails", JSON.stringify(savedEmails.value));

    // perbarui suggestion jika lagi terbuka
    updateSuggestion();
};

const submitLogin = async () => {
    form.processing = true; // mulai spinner
    try {
        const res = await axios.post(route('login'), {
            email: form.email,
            password: form.password,
            remember: form.remember
        }, {
            headers: { 'X-Requested-With': 'XMLHttpRequest' }
        });

        // simpan email ke history saat login berhasil
        saveEmailToHistory();

        if (res.data.redirect) {
            window.location.href = res.data.redirect;
        }
    } catch (err) {
        let msg = 'These credentials do not match our records.';
        if (err.response?.status === 422 && err.response.data.errors) {
            const errors = err.response.data.errors;
            msg = errors.email ? errors.email[0] : msg;
        }
        alertError.value.open(msg);
    } finally {
        form.processing = false; // hentikan spinner
    }
}
</script>

<template>
    <div class="flex flex-col h-screen md:flex-row bg-gradient-to-br from-white to-blue-50 overflow-hidden">

        <!-- Alert Error -->
        <AlertError ref="alertError" title="Login Failed" />

        <!-- Left Panel (LMS Version) -->
        <!-- <div
            class="sm:flex hidden flex-col justify-start items-start w-full md:w-1/2 p-10 bg-gradient-to-br from-[#1e1b4b] via-[#312e81] to-[#4c1d95] text-white relative overflow-hidden pb-24"> -->
        <div
            class="sm:flex hidden flex-col justify-start items-start w-full md:w-1/2 p-10 bg-gradient-to-br from-[#063970] via-[#0a4e8c] to-[#0f6ab4] text-white relative overflow-hidden pb-24">

            <!-- Decorative Waves -->
            <div class="absolute bottom-0 left-0 w-full opacity-20 pointer-events-none">
                <svg viewBox="0 0 1440 320" class="w-full h-28 md:h-40">
                    <path fill="#ffffff" fill-opacity="0.3"
                        d="M0,192L60,208C120,224,240,256,360,245.3C480,235,600,181,720,170.7C840,160,960,192,1080,181.3C1200,171,1320,117,1380,90.7L1440,64V320H0Z">
                    </path>
                </svg>
            </div>

            <!-- TOP AREA -->
            <div class="w-full relative mb-4 z-10">
                <div class="flex justify-center">
                    <div class="fade-in-fast h-48 -mt-3 scale-soft -mb-2 overflow-hidden">
                        <img :src="props.loginUrl" class="w-full h-full leading-none object-cover" alt="Logo Sekolah">
                    </div>
                </div>

                <h3 class="text-2xl md:text-3xl font-bold text-center tracking-wide 
                    flex items-center justify-center gap-3 fade-in-fast scale-soft">
                    <Link class="text-2xl hover:text-amber-500 font-semibold">LMS NUSAVERSE</Link>
                    <span>X</span>
                    <Link class="text-2xl hover:text-amber-500 font-semibold">SMK NUSANTARA</Link>
                </h3>

                <p class="mt-2 text-center fade-in-fast scale-soft opacity-90 text-sm md:text-base">
                    Nusantara Learning Management System
                </p>
            </div>

            <!-- FEATURES AREA (Modern Style) -->
            <div class="relative fade-in-fast scale-soft z-10 mt-4 mx-auto grid grid-cols-1 gap-4 md:gap-5">

                <!-- FEATURE ITEM -->
                <div
                    class="flex cursor-pointer items-center gap-3 bg-white/10 backdrop-blur-sm px-4 py-3 rounded-xl border border-white/20 hover:bg-white/20 transition duration-200">
                    <BuildingLibraryIcon class="w-6 h-6 text-white flex-shrink-0" />
                    <p class="text-sm md:text-base opacity-95">Profil Sekolah - SMK NUSANTARA</p>
                </div>

                <!-- FEATURE ITEM -->
                <Link :href="route('mading.index')" prefetch preserve-scroll preserve-state
                    class="flex items-center gap-3 bg-white/10 backdrop-blur-sm px-4 py-3 rounded-xl border border-white/20 hover:bg-white/20 transition duration-200">
                    <MegaphoneIcon class="w-6 h-6 text-white flex-shrink-0" />
                    <p class="text-sm md:text-base opacity-95">Mading Sekolah - SMK NUSANTARA</p>
                </Link>

                <!-- FEATURE ITEM -->
                <div
                    class="flex cursor-pointer items-center gap-3 bg-white/10 backdrop-blur-sm px-4 py-3 rounded-xl border border-white/20 hover:bg-white/20 transition duration-200">
                    <DocumentTextIcon class="w-6 h-6 text-white flex-shrink-0" />
                    <p class="text-sm md:text-base opacity-95">Panduan Penggunaan Aplikasi LMS</p>
                </div>

            </div>


            <!-- FOOTNOTE -->
            <p class="absolute fade-in-fast scale-soft bottom-3 left-0 right-0 text-center text-xs opacity-70 z-10">
                 {{ new Date().getFullYear() }} Nusantara Learning Management System  All Rights Reserved.
            </p>
        </div>


        <!-- Right Panel -->
        <div class="flex min-h-screen flex-col items-center justify-center w-full p-6 bg-white md:w-1/2 fade-in-fast">
            <div
                class="w-full max-w-md text-start bg-white/60 backdrop-blur-md sm:p-6 sm:rounded-2xl sm:shadow-lg sm:border sm:border-gray-100 scale-soft">

                <div class="no-select h-60 pl-3 sm:hidden flex items-center justify-center">
                    <img :src="props.mobileUrl" class="w-full h-full object-cover leading-none" alt="Logo Sekolah">
                </div>

                <h4 class="mb-2 text-2xl sm:block hidden font-bold capitalize text-[#063970]">Sign In</h4>
                <p class="mb-8 -mt-3 text-sm sm:text-left text-center text-slate-500">Nusantara <span
                        class="sm:hidden inline-block">School</span> Member Directory</p>

                <!-- Login Form -->
                <form @submit.prevent="submitLogin">

                    <!-- EMAIL -->
                    <div class="relative mb-6">
                        <input type="email" v-model="form.email" @input="updateSuggestion"
                            @focus="isEmailFocused = true; updateSuggestion()"
                            @blur="isEmailFocused = false; clearSuggestions()" placeholder=" " required
                            class="peer pl-4 w-full px-3 py-3 border border-gray-300 rounded-xl bg-white/70 backdrop-blur focus:outline-none focus:ring-2 focus:ring-blue-600 transition-all" />

                        <label :class="[
                            'absolute left-5 px-1 text-base bg-white transition-all pointer-events-none',
                            (form.email || isEmailFocused)
                                ? '-top-3 text-blue-600 text-sm'
                                : 'top-3 text-gray-500 text-base'
                        ]">Email Address</label>

                        <!-- Suggestions -->
                        <ul v-if="suggestions.length"
                            class="absolute z-20 w-full bg-white border border-gray-300 rounded-lg shadow-xl mt-1 animate-fade">

                            <li v-for="email in suggestions" :key="email"
                                class="px-4 py-2 flex justify-between items-center hover:bg-gray-100 cursor-pointer">

                                <div class="flex items-center gap-2 w-full" @click="chooseEmail(email)">
                                    <i class="bi bi-clock-history text-gray-500"></i>
                                    {{ email }}
                                </div>

                                <button type="button" @click.stop="deleteSingleEmail(email)"
                                    class="text-gray-400 hover:text-red-500">
                                    <i class="bi bi-x-lg"></i>
                                </button>
                            </li>
                        </ul>
                    </div>

                    <!-- PASSWORD -->
                    <div class="relative mb-4">
                        <input :type="showPassword ? 'text' : 'password'" v-model="form.password" required minlength="6"
                            placeholder=" " @focus="isPasswordFocused = true" @blur="isPasswordFocused = false"
                            class="peer pl-4 w-full px-3 py-3 border border-gray-300 rounded-xl bg-white/70 backdrop-blur focus:outline-none focus:ring-2 focus:ring-blue-600 transition-all" />

                        <label :class="[
                            'absolute left-5 px-1 text-base bg-white transition-all pointer-events-none',
                            (form.password || isPasswordFocused)
                                ? '-top-3 text-blue-600 text-sm'
                                : 'top-3 text-gray-500 text-base'
                        ]">Password</label>

                        <button type="button" class="absolute text-gray-500 right-5 top-3.5" @click="togglePassword">
                            <i :class="showPassword ? 'bi bi-eye' : 'bi bi-eye-slash'"></i>
                        </button>
                    </div>

                    <!-- REMEMBER | FORGOT -->
                    <div class="flex items-center justify-between px-2 mb-4">
                        <div class="hidden md:flex items-center gap-2">
                            <input type="checkbox" v-model="form.remember" class="rounded-sm" />
                            <span class="text-slate-700 text-sm">Remember Me</span>
                        </div>

                        <small class="font-semibold text-slate-700 text-sm">
                            Forgot password?
                            <Link :href="route('password.request')" prefetch preserve-scroll
                                class="text-blue-600 hover:underline">
                                Click Here
                            </Link>
                        </small>
                    </div>

                    <!-- SUBMIT -->
                    <div class="mb-3">
                        <button type="submit" :disabled="form.processing"
                            class="w-full py-2 font-semibold text-white bg-gradient-to-br from-[#063970] via-[#0a4e8c] to-[#0f6ab4] rounded-xl hover:from-[#052c5a] hover:via-[#09406f] hover:to-[#0c5490] transition-all flex justify-center items-center gap-2">

                            <svg v-if="form.processing" class="w-5 h-5 animate-spin text-white" fill="none"
                                viewBox="0 0 24 24">
                                <circle class="opacity-25" cx="12" cy="12" r="10" stroke="currentColor"
                                    stroke-width="4" />
                                <path class="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v4a4 4 0 00-4 4H4z" />
                            </svg>

                            <span>{{ form.processing ? 'Loading...' : 'LOG IN' }}</span>
                        </button>
                    </div>

                    <!-- REGISTER -->
                    <div class="text-center text-sm mb-4">
                        Don't have an account?
                        <Link :href="route('register')" prefetch preserve-scroll preserve-state :only="[]"
                            class="font-semibold text-blue-600 hover:underline">
                            Sign up
                        </Link>
                    </div>

                    <!-- DIVIDER -->
                    <div class="flex items-center px-2 my-4">
                        <hr class="flex-grow border-gray-300" />
                        <span class="mx-3 text-sm font-semibold text-black">OR</span>
                        <hr class="flex-grow border-gray-300" />
                    </div>

                    <!-- GOOGLE -->
                    <a :href="route('google.redirect')"
                        class="mt-6 w-full flex items-center justify-center gap-2 py-2 border border-gray-300 rounded-xl hover:bg-gray-50 transition-all">
                        <img src="https://img.icons8.com/color/20/000000/google-logo.png" />
                        Log in with Google
                    </a>

                </form>
            </div>
        </div>
    </div>
</template>
